import { Component } from "react";

class CharacterList extends Component {
  render() {
    const { name, image } = this.props.list;

    return (
      <div>
        <img src={image} alt="personagens"></img>
        <label>{name}</label>
      </div>
    );
  }
}
export default CharacterList;
